/**
 * 本地存储
 */

var LocalStore = Backbone.Model.extend({
    defaults: {
        ver: "",        //存储数据的版本
        data: "",       //存储的数据
        updateCycle: 0,     //数据更新的周期，单位：秒，表示最后一次更新后，间隔多少秒需要更新
        lastUpdate: null    //最后一次更新的时间戳(使用1970年1月1日至今的毫秒数表示）, null表示没有更新
    },
    parse: function(str) {
        if (str) {
            var data = JSON.parse(str);
            if (data) {
                this.set(data);
            }
        }
        return this;
    },
    //从H5本地存储读取指定key值的数据
    load: function(key) {
        var value = localStorage.getItem(key);
        return this.parse(value);
    },
    //保存当前对象的数据保存到key对应的H5本地存储中
    save: function(key) {
        this.set("lastUpdate", new Date().getTime());
        localStorage.setItem(key, JSON.stringify(this));
    },
    //判断是否需求从服务器获取更新
    needUpdate: function() {
        var result = true;
        var lastUpdate = this.get("lastUpdate");
        var updateCycle = this.get("updateCycle");

        if(lastUpdate) {
            var now = new Date().getTime();
            if((now-lastUpdate)/1000 < updateCycle)
                result = false;
        }
        return result;
    }
});
